import React from "react";
import { useLocation } from "react-router-dom";
import Cake from "../assets/birthdaycake.png";

const Event = (props) => {
  const data = props.location.state;
  console.log(data);
  return (
    <div className="w-full bg-white">
      <div className="flex flex-col justify-center items-center">
        <img
          src={Cake}
          className="my-4 w-1/4 h-1/4 object-cover rounded-xl"
          alt="/"
        />
      </div>{" "}
      <div className="flex flex-col items-center">
        <p className="uppercase text-3xl tracking-widest text-[#517be5] align-start">
          {data[0].eventName}
        </p>
        <p className="text-sm tracking-widest text-[#517be5]">
          Hosted By: {data[0].hostName}
        </p>
        <p className="text-xl tracking-widest text-[#517be5]">
          {data[0].eventDescription}
        </p>
        <span>
          {data[0].startDate} to {data[0].endDate}
        </span>
      </div>
    </div>
  );
};

export default Event;
